import { NavLink } from "react-router-dom";

const NewsCard = () =>{
    return(
        <>
            <div className="col-lg-4 col-md-12 newsCard">
                <img src="Images/news1.png" alt="" />
                <h3>Climate Change and its Impact on Agriculture in Pakistan</h3>
                <p>Climate change is one of the biggest challenges facing agriculture in Pakistan.</p>
                <NavLink to="/" >Read More</NavLink>


                </div>
        </>

    )
}

export default NewsCard;
